import axios from 'axios';

var abortController = new AbortController();
var signal = abortController.signal;

export default function getUsers (){
    return axios.get(`https://api.github.com/users`, {signal : signal})
    .then (data => {
        return data;
    })
    .catch (err => {
        return err;
    })
}
